import React from 'react';
import { Table } from 'semantic-ui-react';
import Axios from 'axios';

class Home extends React.Component{

    state={
        fullData:[],
        page:[]
    }

    componentDidMount(){
        Axios.get('https://todo-34b9f.firebaseio.com/page.json')
        .then(response => {
            console.log(response);
            this.setState({fullData:response.data});
            console.log(this.state.fullData);
        }).catch(error =>{
            console.log(error);
        })
    }


    render(){
        let page;

        page=
        <Table border="1px" width="100%">
            <Table.Header>
                <Table.Cell>Title</Table.Cell>
                <Table.Cell>Actions</Table.Cell>
            </Table.Header>

            {this.state.fullData.map(perPage => (
                <Table.Row>
                    <Table.Cell>{perPage.title}</Table.Cell>
                    <Table.Cell>{perPage.description}</Table.Cell>
                </Table.Row>
            ))}
            </Table>



        return(
            <>
            <h1> Pages </h1>
            {page}
            </>
        )
    }
}

export default Home;
